## Retrieve information from compressed data
genes = h5read(destination_file, "meta/genes/genes")
samples = h5read(destination_file, "meta/samples/geo_accession")
singlecellprobability = h5read(destination_file, "meta/samples/singlecellprobability")
readsaligned = h5read(destination_file, "/meta/samples/readsaligned")
gene_biotype = h5read(destination_file, "/meta/genes/gene_biotype") 
protein_coding_ind = which(gene_biotype == 'protein_coding') 

## Identify columns to be extracted
sample_locations = intersect(intersect(which(samples %in% samp),which(singlecellprobability < 0.5)),
                             which(readsaligned >= 2000000 & readsaligned <= 20000000))
expression = t(h5read(destination_file, "data/expression", index=list(sample_locations, protein_coding_ind)))
H5close()
rownames(expression) = genes[gene_biotype == 'protein_coding']
colnames(expression) = samples[sample_locations]

## Quantile normalization
expression = log2(expression+1)
expression = normalize.quantiles(expression)
rownames(expression) = genes[gene_biotype == 'protein_coding']
colnames(expression) = samples[sample_locations]

## Delete genes with zero expression in all samples
row_sub = apply(expression, 1, function(row) all(row >0.001 ))
expression_nonzero = expression[row_sub,]

## Select the most variable genes
mostvariablegenes <- names(tail(sort(apply(expression_nonzero,1,var)), n=10000))
expression_nonzero_mostvar <- expression_nonzero[which(rownames(expression_nonzero) %in% mostvariablegenes),]


## Transcription Factors used in analysis (AnimalTFDB 3.0)
TF = read.csv('TF.csv', header = FALSE)
Factors = as.vector(TF$V1)
Factors = Factors[Factors %in% rownames(expression_nonzero)]


## Run GENIE3
set.seed(123)
weightMatrix <-GENIE3(exprMatrix=expression_nonzero, regulators =Factors, targets = NULL, 
                      treeMethod = "RF", K = "sqrt", nTrees = 1000, nCores = 24,
                      returnMatrix = TRUE, verbose = TRUE)

## Get ranking of edges
linkList <- getLinkList(weightMatrix)
write.table(weightMatrix, file="weightMatrix_mostvar.csv")
write.table(linkList, file="linkList_mostvar.csv")


## VIPER
linkList <- read.table("linkList_mostvar.csv", quote="\"", comment.char="")
linkList$V1 <- NULL
colnames(linkList)[1] <- "regulatory.gene"
colnames(linkList)[2] <- "target.gene"
colnames(linkList)[3] <- "weight"
linkList <- linkList[linkList$weight>0,]
linkList_mostvar <- linkList[order(linkList$weight, decreasing=TRUE),]

write.table(head(linkList_mostvar,10000), file = "NETWORK_tcells_10.tsv", sep = "\t", quote = F, row.names = F, col.names = F)
write.table(head(linkList_mostvar,50000), file = "NETWORK_tcells_50.tsv", sep = "\t", quote = F, row.names = F, col.names = F)

nwfile10 <- "NETWORK_tcells_10.tsv"
nwfile50 <- "NETWORK_tcells_50.tsv"
regulon10 <-  aracne2regulon(afile=nwfile10, eset = expression_nonzero_mostvar, gene = FALSE, format = "3col", verbose = T)
regulon50 <-  aracne2regulon(afile=nwfile50, eset = expression_nonzero_mostvar, gene = FALSE, format = "3col", verbose = T)


