write.table(NES, file = "NES_tcells.tsv", sep = "\t", quote = F, row.names = F, col.names = T)
write.table(Pval, file = "Pval_tcells.tsv", sep = "\t", quote = F, row.names = F, col.names = T)

## Heatmap

df <- NES[,-1]
rownames(df) <- NES$TF
df[is.na(df)] <- 0
df2 <- Pval[,-1]
rownames(df2) <- Pval$TF
df2[is.na(df2)] <- 100
df2[df2 <= 0.05] <- "\uFF0A"
df2[df2 != "\uFF0A"] <- ''
sign_genes <- df2 %>% filter_all(any_vars(. %in% c("\uFF0A")))
sign_genes_nes <- df[c(rownames(sign_genes)),]


pheatmap(as.matrix(sign_genes_nes), display_numbers = sign_genes, 
         fontsize_number = 7.5,
         scale = "row",
         angle_col = 45, fontsize_row=10,fontsize_col = 12,treeheight_row = 82, treeheight_col = 42, 
         cluster_cols = F, show_rownames = T )




